import {useParams} from 'react-router-dom';
import {useState}from 'react';
import Api from '../../services/api';
import Button from '../../components/utils/button/button';
import InputMask from 'react-input-mask';
import '../editProfile/editprofile.css';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';


export default function ProfilePerfil() {

    const [specialization, setSpecialization] =  useState('');
    const [phone, setPhone] =  useState('');

    const {idUsuario} = useParams();
    
    

async function handleSubmit(e){
    e.preventDefault();
    const data = {
        specialization:specialization,
        phone:phone,}


    const config = {
        headers:{
            Authorization:localStorage.getItem('token')
    }
    
}
try {
    if(specialization!==''&&phone!==''){
        const response = await Api.put(`updateUser/${idUsuario}`,data, config);

        if(response.status===200){
          window.location.href='/viewProfile'
        }else{
          alert('Error updating user!');
        }
      }else{
        alert('Please fill in all data!');
      }
} catch (error) {
    const { data } = error.response;
    alert(data.message);
}
   
}
    return(
            <div>
               <div><a href="/home"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="Smart Palm"/></a></div>
                    <br></br>
                    <br></br>
                    <form>
                    <text className = {'title'}>Edit profile</text>
                    <br/>
                    <br></br>
                    <div className={"question"}>
                        <br/>
                    <InputLabel id="labelTipo">Specialization</InputLabel>
                    <Select
                      labelId="labelTipo"
                      id="tipo"
                      value={specialization}
                      onChange={e => setSpecialization(e.target.value)}
                    >
                      <MenuItem value={1}>Cardiologia</MenuItem>
                      <MenuItem value={2}>Dermatologia</MenuItem>
                      <MenuItem value={3}>Ginecologia e Obstetrícia</MenuItem>
                      <MenuItem value={4}>Ortopedia</MenuItem>
                      <MenuItem value={5}>Anestesiologia</MenuItem>
                      <MenuItem value={6}>Pediatria</MenuItem>
                      <MenuItem value={7}>Oftalmologia</MenuItem>
                      <MenuItem value={8}>Psiquiatria</MenuItem>
                      <MenuItem value={9}>Urologia</MenuItem>
                      <MenuItem value={10}>Oncologia</MenuItem>
                      <MenuItem value={11}>Endocrinologia</MenuItem>
                      <MenuItem value={12}>Neurologia</MenuItem>
                      <MenuItem value={13}>Hematologia</MenuItem>
                      <MenuItem value={14}>Cirurgia Plástica</MenuItem>
                    </Select>
                    </div>
                    <br></br>
                     <div className={"question"}>
                         <InputMask mask="(99) 99999-9999" id="phone" name="phone" type="text" required
                            onChange={e => setPhone(e.target.value)}
                        />
                            
                        <label>Phone:</label>   
        
                        </div>
                        <br></br>
                        <Button onClick={handleSubmit}  buttonSize='btn--large'  type="submit">To edit</Button>
                
                    </form>
                    
            </div>
        )
}
